function Icons() {
  return (
    <>
      <img src="email.svg" alt="email" />
      <img src="instagram.svg" alt="instagram" />
      <img src="linkedin.svg" alt="linkedin" />
      <img src="send.svg" alt="send" />
      <img src="twitter.svg" alt="twitter" />
      <img src="whatsapp.svg" alt="whatsapp" />
      <img src="zoom.svg" alt="zoom" />
    </>
  );
}
function HeadLeftFooter() {
  return <h1>Let's grab some coffee!</h1>;
}
function BottomLeftFooter() {
  return (
    <>
      <img src="madeBy.png" alt="MADE_BY" className="made-by-img" />
      <img src="gallery.png" alt="GALLERY" className="gallery-img" />
      <p>saja.Gallery 2023 Â© || Developed By Ahmed El-Sammak</p>
    </>
  );
}
export default function Footer() {
  return (
    <>
      <Icons />
      <HeadLeftFooter />
      <BottomLeftFooter />
    </>
  );
}
